import React from "react";
import { Link } from "react-router-dom";

const Header = () =>{
    return(
        <>
        <header>
            <div className="container flexSB">
                <nav className="flexSB">
                    <div className="logo">
                        <img src="./images/logo.png" alt="Logo Image" />
                    </div>
                    <ul className="flexSB">
                        <Link to="/">Home</Link>
                    </ul>
                </nav>
            </div>
        </header>
        </>
    )
}

export default Header;
